import React, { useState } from "react";
import * as XLSX from "xlsx";
import Papa from "papaparse";
import { Upload, Download, BarChart3, Filter, FileSpreadsheet, TrendingUp, Users, Clock } from "lucide-react";

const FileUploader = ({ onFileUpload }) => {
  const [isDragging, setIsDragging] = useState(false);

  const handleDragEnter = (e) => {
    e.preventDefault();
    setIsDragging(true);
  };

  const handleDragLeave = (e) => {
    e.preventDefault();
    setIsDragging(false);
  };

  const handleDragOver = (e) => {
    e.preventDefault();
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setIsDragging(false);
    const files = e.dataTransfer.files;
    if (files.length > 0) {
      onFileUpload(files[0]);
    }
  };

  const handleFileSelect = (e) => {
    const file = e.target.files[0];
    if (file) {
      onFileUpload(file);
    }
  };

  return (
    <div
      className={`relative border-2 border-dashed rounded-2xl p-12 text-center transition-all duration-300 cursor-pointer group ${
        isDragging
          ? "border-blue-600 bg-blue-50 scale-105"
          : "border-slate-300 hover:border-blue-500 hover:bg-slate-50"
      }`}
      onDragEnter={handleDragEnter}
      onDragLeave={handleDragLeave}
      onDragOver={handleDragOver}
      onDrop={handleDrop}
      onClick={() => document.getElementById("fileInput").click()}
    >
      <div className="flex flex-col items-center space-y-4">
        <div className={`p-4 rounded-full transition-all duration-300 ${
          isDragging ? "bg-blue-100" : "bg-slate-100 group-hover:bg-blue-100"
        }`}>
          <Upload className={`w-12 h-12 transition-colors duration-300 ${
            isDragging ? "text-blue-600" : "text-slate-500 group-hover:text-blue-600"
          }`} />
        </div>
        <div>
          <h3 className="text-xl font-semibold text-slate-800 mb-2">
            Excel 파일을 업로드하세요
          </h3>
          <p className="text-slate-600 mb-4">
            파일을 드래그 앤 드롭하거나 클릭하여 선택하세요
          </p>
          <div className="inline-flex items-center px-6 py-3 bg-gradient-to-r from-blue-700 to-blue-800 text-white rounded-lg font-medium hover:from-blue-800 hover:to-blue-900 transition-all duration-300 shadow-lg hover:shadow-xl">
            <FileSpreadsheet className="w-5 h-5 mr-2" />
            파일 선택
          </div>
        </div>
      </div>
      <input
        id="fileInput"
        type="file"
        accept=".xlsx,.xls"
        onChange={handleFileSelect}
        className="hidden"
      />
    </div>
  );
};

const ChartSection = ({ filteredData }) => {
  // 직무별 통계
  const jobStats = filteredData.reduce((acc, item) => {
    const job = item.직무 || "기타";
    acc[job] = (acc[job] || 0) + 1;
    return acc;
  }, {});

  // 직무연차별 통계
  const yearStats = filteredData.reduce((acc, item) => {
    const year = item.직무연차 || "미정";
    acc[year] = (acc[year] || 0) + 1;
    return acc;
  }, {});

  const StatCard = ({ title, value, icon: Icon, color }) => (
    <div className="bg-white rounded-xl p-6 shadow-lg hover:shadow-xl transition-all duration-300 border border-slate-200">
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm font-medium text-slate-600 mb-1">{title}</p>
          <p className="text-3xl font-bold text-slate-900">{value}</p>
        </div>
        <div className={`p-3 rounded-full ${color}`}>
          <Icon className="w-6 h-6 text-white" />
        </div>
      </div>
    </div>
  );

  const ChartBar = ({ label, value, maxValue, color }) => (
    <div className="mb-4">
      <div className="flex justify-between items-center mb-2">
        <span className="text-sm font-medium text-slate-700">{label}</span>
        <span className="text-sm font-bold text-slate-900">{value}명</span>
      </div>
      <div className="w-full bg-slate-200 rounded-full h-3">
        <div
          className={`h-3 rounded-full transition-all duration-1000 ${color}`}
          style={{ width: `${(value / maxValue) * 100}%` }}
        />
      </div>
    </div>
  );

  const maxJobValue = Math.max(...Object.values(jobStats));
  const maxYearValue = Math.max(...Object.values(yearStats));

  return (
    <div className="space-y-8">
      {/* 통계 카드 */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <StatCard
          title="총 면담자 수"
          value={filteredData.length}
          icon={Users}
          color="bg-gradient-to-r from-blue-600 to-blue-700"
        />
        <StatCard
          title="직무 유형"
          value={Object.keys(jobStats).length}
          icon={BarChart3}
          color="bg-gradient-to-r from-slate-600 to-slate-700"
        />
        <StatCard
          title="연차 범위"
          value={Object.keys(yearStats).length}
          icon={Clock}
          color="bg-gradient-to-r from-red-600 to-red-700"
        />
      </div>

      {/* 차트 섹션 */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
        <div className="bg-white rounded-xl p-6 shadow-lg border border-slate-200">
          <h3 className="text-lg font-semibold text-slate-800 mb-6 flex items-center">
            <TrendingUp className="w-5 h-5 mr-2 text-blue-600" />
            직무별 분포
          </h3>
          <div className="space-y-4">
            {Object.entries(jobStats).map(([job, count]) => (
              <ChartBar
                key={job}
                label={job}
                value={count}
                maxValue={maxJobValue}
                color="bg-gradient-to-r from-blue-500 to-blue-600"
              />
            ))}
          </div>
        </div>

        <div className="bg-white rounded-xl p-6 shadow-lg border border-slate-200">
          <h3 className="text-lg font-semibold text-slate-800 mb-6 flex items-center">
            <Clock className="w-5 h-5 mr-2 text-slate-600" />
            직무연차별 분포
          </h3>
          <div className="space-y-4">
            {Object.entries(yearStats).map(([year, count]) => (
              <ChartBar
                key={year}
                label={year}
                value={count}
                maxValue={maxYearValue}
                color="bg-gradient-to-r from-slate-500 to-slate-600"
              />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

const DownloadButtons = ({ onDownload }) => (
  <button
    onClick={onDownload}
    className="inline-flex items-center px-8 py-4 bg-gradient-to-r from-blue-700 to-blue-800 text-white rounded-xl font-semibold hover:from-blue-800 hover:to-blue-900 transition-all duration-300 shadow-lg hover:shadow-xl transform hover:scale-105"
  >
    <Download className="w-5 h-5 mr-2" />
    필터링 결과 CSV 다운로드
  </button>
);

const App = () => {
  const [uploaded, setUploaded] = useState(false);
  const [data, setData] = useState([]);
  const [selectedJob, setSelectedJob] = useState("all");
  const [selectedYear, setSelectedYear] = useState("all");
  const [loading, setLoading] = useState(false);

  const jobOptions = ["all", ...new Set(data.map((item) => item.직무 || ""))];
  const yearOptions = ["all", ...new Set(data.map((item) => item.직무연차 || ""))];

  const filteredData = data.filter((item) => {
    const jobMatch = selectedJob === "all" || item.직무 === selectedJob;
    const yearMatch = selectedYear === "all" || item.직무연차 === selectedYear;
    return jobMatch && yearMatch;
  });

  const handleFileUpload = (file) => {
    setLoading(true);
    const reader = new FileReader();
    reader.onload = (e) => {
      try {
        const bytes = e.target.result;
        const workbook = XLSX.read(bytes, { type: "binary" });
        const sheet = workbook.Sheets[workbook.SheetNames[0]];
        const parsedData = XLSX.utils.sheet_to_json(sheet, { header: 1 });

        const headers = parsedData[0];
        const rows = parsedData.slice(1).filter((row) => row.some((cell) => cell));
        const jsonData = rows.map((row) =>
          headers.reduce((obj, header, index) => {
            obj[header] = row[index] || "";
            return obj;
          }, {})
        );

        setData(jsonData);
        setUploaded(true);
        console.log("파싱된 Excel 데이터:", jsonData);
      } catch (error) {
        console.error("Excel 파싱 에러:", error);
        alert("파일 파싱에 실패했습니다. Excel 형식을 확인하세요.");
      } finally {
        setLoading(false);
      }
    };
    reader.readAsBinaryString(file);
  };

  const downloadCSV = () => {
    const csv = Papa.unparse(filteredData);
    const blob = new Blob([csv], { type: "text/csv;charset=utf-8;" });
    const url = URL.createObjectURL(blob);
    const link = document.createElement("a");
    link.href = url;
    link.download = "filtered_interview_data.csv";
    link.click();
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 via-blue-50 to-slate-100">
      <div className="max-w-7xl mx-auto px-4 py-8">
        {/* 헤더 */}
        <div className="text-center mb-12">

        <div className="mb-6">
            <div className="inline-flex items-center space-x-2 mb-4">
              <img 
                src="https://www.skenmove.com/resources/images/common/favicon.ico" 
                alt="SK엔무브 로고" 
                className="w-8 h-8"
              />
              <span className="text-2xl font-bold text-slate-700">SK엔무브</span>
            </div>
          </div>
          <h1 className="text-5xl font-bold bg-gradient-to-r from-blue-700 via-blue-800 to-slate-700 bg-clip-text text-transparent mb-4">
            면담결과 대시보드
          </h1>
          <p className="text-xl text-slate-600 max-w-2xl mx-auto">
            Excel 파일을 업로드하여 면담 데이터를 시각화하고 분석하세요
          </p>
        </div>

        {/* 파일 업로드 */}
        <div className="mb-12">
          <FileUploader onFileUpload={handleFileUpload} />
          {loading && (
            <div className="mt-8 flex flex-col items-center">
              <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-700"></div>
              <p className="mt-4 text-lg text-slate-600 font-medium">파일을 분석 중입니다...</p>
            </div>
          )}
        </div>

        {uploaded && (
          <>
            {/* 필터 섹션 */}
            <div className="mb-12 bg-white rounded-2xl p-8 shadow-lg border border-slate-200">
              <h2 className="text-2xl font-semibold text-slate-800 mb-6 flex items-center">
                <Filter className="w-6 h-6 mr-2 text-blue-700" />
                데이터 필터링
              </h2>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div>
                  <label className="block text-sm font-semibold text-slate-700 mb-3">
                    직무별 필터
                  </label>
                  <select
                    value={selectedJob}
                    onChange={(e) => setSelectedJob(e.target.value)}
                    className="w-full p-4 text-base border-2 border-slate-200 rounded-xl shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-600 focus:border-blue-600 transition-all duration-300"
                  >
                    {jobOptions.map((option) => (
                      <option key={option} value={option}>
                        {option === "all" ? "🌐 전체 직무" : `💼 ${option}`}
                      </option>
                    ))}
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-semibold text-slate-700 mb-3">
                    직무연차별 필터
                  </label>
                  <select
                    value={selectedYear}
                    onChange={(e) => setSelectedYear(e.target.value)}
                    className="w-full p-4 text-base border-2 border-slate-200 rounded-xl shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-600 focus:border-blue-600 transition-all duration-300"
                  >
                    {yearOptions.map((option) => (
                      <option key={option} value={option}>
                        {option === "all" ? "📊 전체 연차" : `⏰ ${option}`}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
            </div>

            {/* 시각화 섹션 */}
            <div className="mb-12">
              {filteredData.length === 0 ? (
                <div className="bg-white rounded-2xl p-12 text-center shadow-lg border border-slate-200">
                  <div className="w-16 h-16 mx-auto mb-4 bg-slate-100 rounded-full flex items-center justify-center">
                    <BarChart3 className="w-8 h-8 text-slate-400" />
                  </div>
                  <h3 className="text-xl font-semibold text-slate-800 mb-2">데이터가 없습니다</h3>
                  <p className="text-slate-600">선택된 조건에 맞는 면담 결과가 없습니다.</p>
                </div>
              ) : (
                <ChartSection filteredData={filteredData} />
              )}
            </div>

            {/* 다운로드 섹션 */}
            {filteredData.length > 0 && (
              <div className="text-center">
                <DownloadButtons onDownload={downloadCSV} />
              </div>
            )}
          </>
        )}
      </div>
    </div>
  );
};

export default App;
